import { Table } from 'antd';
import { EditOutlined , DeleteOutlined } from '@ant-design/icons';
import { connect } from 'react-redux';

const Rtable = (props) =>{
  const [data , setData]=useState({
    fname:'',
    mname:'',
    lname:'',
    gender:'',
    country:'',
    city:'',
    language:[],
    game:[]
  });
  const [userData , setUserData]=useState([])
  const [index , setIndex]=useState('')

const columns = [
    {
      title: 'FIRST NAME',
      dataIndex: 'fname',
      key: 'fname',
    },
    {
      title: 'MIDDLE NAME',
      dataIndex: 'mname',
      key: 'mname',
    },
    {
      title: 'LAST NAME',
      dataIndex: 'lname',
      key: 'lname',
    },
    {
      title: 'GENDER',
      dataIndex: 'gender',
      key: 'gender',
    },
    {
      title: 'COUNTRY',
      dataIndex: 'country',
      key: 'country',
    },
    {
      title: 'CITY',
      dataIndex: 'city',
      key: 'city',
    },
    {
      title: 'LANGUAGE',
      dataIndex: 'language',
      key: 'language',
      render:(r)=>(
        <>
        {r + ''}
        </>
      )
    },
    {
      title: 'GAME',
      dataIndex: 'game',
      key: 'game',
      render:(r)=>(
        <>
        {r + ''}
        </>
      )
    },
    {
      title: 'ACTION',
      dataIndex: 'action',
      key: 'action',
  
      render:(dat,i,r) => (
        <>
          <EditOutlined onClick={() =>props.EditRow(dat,i,r)} />
          <DeleteOutlined onClick={() => props.DeleteRow(dat,i,r)} />
        </>
      )
    }
  ];

  return(
    <Table dataSource={props.tableData} columns={columns} />
  )
 }

const mapStateToProps =(state) =>{
  return{
    tableData:state.data,
  }
}
 
export default connect(mapStateToProps,null) (Rtable);
